import React from 'react'
import { BlogsData } from '../data/BlogsData'

const Blogs = () => {
    return (
        <div>
            <header id="page-header">
                <div className="page-heading">
                    <h2>Blogs</h2>
                </div>
            </header>

            <div className="page-container">
                <div className="row">
                    {BlogsData.map(item => {
                        return (
                            <div className="col-md-4">
                                {item.title}

                            </div>
                        )
                    })}
                    <div className="col-md-4">

                    </div>
                </div>
            </div>
        </div>
    )
}

export default Blogs
